function PagesButtons() {
    return (
      <>
        <div>
            <button className="btn-add"> Add Restaruants </button>
        </div>
        <div>
            <button className="btn-add"> Add Hotels </button>
        </div>
        <div>
            <button className="btn-add"> Add Pet Restuarants </button>
        </div>
      </>
    );
  }
  
export default PagesButtons;
